import React from "react";
import { Text, StyleSheet } from "react-native";

const HomeScreen = () => {
  return <Text style={styles}>Updated</Text>;
};

const styles = StyleSheet.create({
  container: {
		flex: 1,
	},
	content: {
		backgroundColor: '#fff',
		padding: 30,
	},
  text: {
    fontSize: 30
  }
});

export default HomeScreen;
